<link rel="stylesheet" type="text/css" href="{% static 'nflapp/style.css' %}"> 
<script src="http://ajax.googleapis.com/ajax/libs/jquery/1.9.1/jquery.min.js"></script>
<script src="https://d3js.org/d3.v7.min.js"></script>
<script>
       $(document).ready(function () {

              var season = document.getElementById('season');
              var week = document.getElementById('week');
              
              season.options[0] = new Option('--Season--', '');
              week.options[0] = new Option('--Week--', '');
              var seasonNum = 1991
              for (let i = 1; i < 32; i++) { 
                     season.options[i] = new Option(seasonNum, seasonNum);
                     seasonNum += 1
              }
              for (let i = 1; i < 19; i++) { 
                     week.options[i] = new Option(i, i);
              }
       });   

</script>
</head>
<body>
<h1>NFL Game Recommender</h1>

<div class="col-md-4">
	<form action="{% url 'results' %}" method="get">
              <select class="form-control" id='season' name='season'>
              </select>
              
              <select class="form-control"  id='week' name='week' onchange="getStuff()">
              </select>
              
              <select class="form-control"  id='game' name='game'>
              </select>
              
              <input name="num_games" typ="text" placeholder="Number of results" id='num_games'>

              <button type="submit">submit</button>
	</form>
</div>
<br>
{% if messages %}
<br>
<ul class="messages" style="list-style-type:none;">
    {% for message in messages %}
    <li{% if message.tags %} class="{{ message.tags }}"{% endif %}>{{ message }}</li>
    {% endfor %}
</ul>
{% endif %}
